import styled from "styled-components";

const NavCss = styled.nav`
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  padding: 0 10px;
  font-size: 16px;
  font-weight: 1000;
  border-top: 1px solid black;
`;
export default NavCss
